  false,\n\t\"url\": null,\n\t\"notes\": \"This data set contains human-use resource
  data for airports, aquaculture sites, archaeological/historic sites, boat ramps,
  coast guard stations, dive sites, marinas, recreational beaches, subsistence fishing/collecting
  sites, surfing locations, water intakes, and outfalls in Guam and the Northern Mariana
  Islands. Vector points in this data set represent the human-use site locations.
  Location-specific type and source information are stored in relational data tables
  (described below) designed to be used in conjunction with this spatial data layer.This
  data set comprises a portion of the Environmental Sensitivity Index (ESI) data for
  Guam and the Northern Mariana Islands. ESI data characterize the marine and coastal
  environments and wildlife by their sensitivity to spilled oil. The ESI data include
  information for three main components: shoreline habitats, sensitive biological
  resources, and human-use resources. See also the MGT (Management Area Polygons)
  data layer, part of the larger Guam and Northern Mariana Islands ESI database, for
  additional human-use information.\",\n\t\"license_title\": null,\n\t\"extras\":
